import React, {Component} from 'react';

import Header from "./Header";
import Nav from "./Nav";
import WorkSpace from "./WorkSpace";

class Home extends Component {
    render() {
        return (
            <div>
                <Header/>
                <Nav/>
                <WorkSpace/>
            </div>
        );
    }
}

export default Home;
